import React from 'react';
// import '../App.css';
import {Button} from '../Button';
import './AboutMe.css';
import cchcover from './cchcover.jpg'

function AboutMe() {
    return (
        <>
        <h1 className='about-me'>About Me</h1>
        <ul>
            <img src={cchcover}/>
        </ul>
        </>
    )
}

export default AboutMe
